unsigned long currentSector = -1, res_file_size;

char* TFT_Get_Data(unsigned long offset, unsigned long count, unsigned long *num) {
unsigned long start_sector;
unsigned long fpos;

  Mmc_Chip_Select =0;
  start_sector = Mmc_Get_File_Write_Sector() + offset/512;
  fpos = (unsigned long)offset%512;

  if(start_sector == currentSector+1) {
    Mmc_Multi_Read_Sector(f16_sector.fSect);
    currentSector = start_sector;
  } else if (start_sector != currentSector) {
    if(currentSector != -1)
      Mmc_Multi_Read_Stop();
    Mmc_Multi_Read_Start(start_sector);
    Mmc_Multi_Read_Sector(f16_sector.fSect);
    currentSector = start_sector;
  }

  if(count>512-fpos)
    *num = 512-fpos;
   else
    *num = count;

   return f16_sector.fSect+fpos;
   Mmc_Chip_Select = 1;
}



void Init_Ext_Mem() {
                                  //SPI 3 = SDO 3 on RF8     MOSI       SCK3 = RD15 CLK
                                  //        SDI 3 on RF2     MISO
  // Initialize SPI                           //was 14 14 WORKS AT 224 MEGS
  SPI3_Init_Advanced(_SPI_MASTER, _SPI_8_BIT, 6, _SPI_SS_DISABLE, _SPI_DATA_SAMPLE_Middle, _SPI_CLK_IDLE_HIGH, _SPI_ACTIVE_2_IDLE);
  Delay_ms(10);

 /*Mmc_Init();
   Mmc_Fat_QuickFormat("JB_2021");
   Delay_ms(10);
   RA1_bit = 1;
   Delay_ms(2000);*/

  // Initialize MMC                            120 = 666.2 Khz        80 = 1Mhz     60 = 1.333Mhz     40 = 2Mhz
  if (!Mmc_Fat_Init()) {                     // was  10 = 8Mhz     8 = 10Mhz     //  6 = 13.3Mhz  4 =20Mhz
    // Reinitialize SPI at higher speed         //10 WORKS AT 224 MEGS
    SPI3_Init_Advanced(_SPI_MASTER, _SPI_8_BIT,4, _SPI_SS_DISABLE, _SPI_DATA_SAMPLE_Middle, _SPI_CLK_IDLE_HIGH, _SPI_ACTIVE_2_IDLE);
    // Open resource file for read
    Mmc_Fat_Assign("Seven_In.RES", 0);
    Mmc_Fat_Reset(&res_file_size);
  }
}

