void Set_I2C_Time_Battery_Backup(){

       seconds2  = Dec2Bcd(2);           // NXP Chip With Battery Backup   //   A2h - Write slave address   A3h - Read slave address
       minutes2  = Dec2Bcd(52);
       hours2    = Dec2Bcd(9);
       date3     = Dec2Bcd(29);
       weekday2  = Dec2Bcd(2);   //4 is Thursday  sunday is 0   TUESDAY = 2
       months2   = Dec2Bcd(6);
       years2    = Dec2Bcd(21);

      Soft_I2C_Start();
      Soft_I2C_Write(0xA2);
      Soft_I2C_Write(0x2E);  //STOP  ENABLE REGISTER
      Soft_I2C_Write(0x01);  //Write data set stop            page 17 is an example
      Soft_I2C_Write(0xA4);  //write data (clear prescaler, A4h)
      Soft_I2C_Start();                                                      //bits 1 and 0 = 7.0 pF crystal from Mouser
      Soft_I2C_Write(0xA2);
      Soft_I2C_Write(0x01);   //MINUTES AT 01
     // Soft_I2C_Write(0x00);  //hundreths
      Soft_I2C_Write(seconds2);
      Soft_I2C_Write(minutes2);
    //  Soft_I2C_Write(hours2);
    //  Soft_I2C_Write(date3);
    //  Soft_I2C_Write(weekday2);
   //   Soft_I2C_Write(months2);
   //   Soft_I2C_Write(years2);
      Soft_I2C_Start();
      Soft_I2C_Write(0xA2);
      Soft_I2C_Write(0x2E);  //FOR STOP     2Eh Stop_enable page 13
      Soft_I2C_Write(0x00);  //Write data to clear stop
      Soft_I2C_Stop();
}


